"""## 4.

![image.png](data:image/png;base64,)

##SOLUÇÃO

Para a resolução dessa questão primeiramente calculamos o logaritmo natural da população, o que é necessário para transformar o modelo exponencial em um modelo linear. Após isso, calculamos as somas necessárias para a criação das equações normais de regressão linear. Essas somas são usadas para calcular os coeficientes da função exponencial. Assim,após isso, o código usa as equações normais para calcular os coeficientes da função exponencial.

 Por fim, plotamos o gráfico com o ajuste exponencial de minimos quadrados. Portanto, encontramos os seguintes valores:

 - Equação de ajuste exponencial: p(t) = 0.99 * e^(0.60t)
 - Previsão de população após 5 horas: 19.97 milhares
"""

import numpy as np
import matplotlib.pyplot as plt

# Dados
t = np.array([0, 1, 2, 3, 4])
p = np.array([1.0, 1.8, 3.3, 6.0, 11.0])

# Logaritmo Natural dos Dados
ln_p = np.log(p)

# Cálculo das Soma dos Valores para as Equações
n = len(t)
soma_t = np.sum(t)
soma_ln_p = np.sum(ln_p)
soma_t_ln_p = np.sum(t * ln_p)
soma_t_squared = np.sum(t**2)

# Calculo do coeficiente b e ln (a)
b = (n * soma_t_ln_p - soma_t * soma_ln_p) / (n * soma_t_squared - soma_t**2)
ln_a = (soma_ln_p - b * soma_t) / n
a = np.exp(ln_a)
previsao_populacao = a * np.exp(b * 5)



# Plotar os dados no gráfico
plt.scatter(t, p, label='Dados')
t_range = np.linspace(0, 5, 400)
plt.plot(t_range, a * np.exp(b * t_range), color='red', label='Ajuste exponencial')
plt.xlabel('Horário (horas)')
plt.ylabel('Populaçao (milhares)')
plt.legend()
plt.title('Ajuste exponencial de mínimos quadrados')
plt.show()

print(f"Equação de ajuste exponencial: p(t) = {a:.2f} * e^({b:.2f}t)")
print(f"Previsão de população após 5 horas: {previsao_populacao:.2f} milhares")

