"""## 3.

![image.png](data:image/png;base64,)

##Solução

A regra de Simpson é um método de integração numérica que aproxima a integral definida de uma função usando polinômios quadráticos. A fórmula da regra de Simpson divide o intervalo em subintervalos e usa arcos parabólicos para estimar a integral.

A fórmula para a regra de Simpson para uma função $f(x)$ sobre um intervalo $[a,b]$ com um número par de subintervalos é dado por:

$$\frac{h}{3}*[f(a)+4\sum_{i=1,3,...}^{n-1}f(x_i) + 2\sum_{i=2,4,...}^{n-2}f(x_i)+f(b)] $$

Onde $h$ é a largura de cada subintervalo e $n$ é o número de subintervalos.

Dada a função $f(x) = 2x^5 + 5x^3 - 3x +1$ e o intervalo $[1,2]$, calculamos a integral usando a regra de Simpson e obtvemos:
 - Aproximação usando a regra de Simpson: 36.2578125
"""

def f(x):
    return 2 * x**5 + 5 * x**3 - 3 * x + 1

def regra_simpson (a, b, n):
    h = (b - a) / n
    resultado = f(a) + f(b)

    for i in range(1, n, 2):
        resultado += 4 * f(a + i * h)

    for i in range(2, n - 1, 2):
        resultado += 2 * f(a + i * h)

    resultado *= h / 3
    return resultado

# limite integral
a = 1
b = 2
n = 4
aproximação = regra_simpson (a, b, n)
print(f"Aproximação usando a regra de Simpson: {aproximação}")

