"""## 6.

![image.png](data:image/png;base64,)

##Solução

Para resolver essa questão aplicamos a fórmula da regra de Simpson para calcular a temperatura média (Tav). A fórmula envolve a largura do subintervalo (delta_t), os valores dos extremos (data[0] e data[-1]), os valores somados nos índices ímpares (sum_odd) e os valores somados nos índices pares (sum_even). Definimos o intervalo de tempo em horas, que é 7 horas no seu caso, representando o período de 9 AM a 4 PM. Com isso, obtemos o resultado:
 - Temperatura estimada : 543.60°F
"""

import math

def simpsons_temperatura(data, intervalo_tempo):
    n = len(data) - 1
    delta_t = intervalo_tempo / n

    sum_odd = 0
    sum_even = 0

    for i in range(1, n):
        if i % 2 == 0:
            sum_even += data[i]
        else:
            sum_odd += data[i]

    Tav = (delta_t / 3) * (data[0] + 4 * sum_odd + 2 * sum_even + data[-1])
    return Tav

temperatura = [86.4, 75.3, 77.0, 83.2, 84.8, 86.5, 81.1, 78.6]
intervalo_tempo = 7

average_temperatura = simpsons_temperatura(temperatura, intervalo_tempo)

# Print the result
print(f"Temperatura estimada : {average_temperatura:.2f}°F")